import unittest
from main import *


class Test(unittest.TestCase):
    def test1(self):
        s = '10101'
        result = Solution().numWays(s)
        print(result)

    def test2(self):
        s = '1001'
        result = Solution().numWays(s)
        print(result)

    def test3(self):
        s = '0000'
        result = Solution().numWays(s)
        print(result)

    def test4(self):
        s = "100100010100110"
        result = Solution().numWays(s)
        print(result)

    def test5(self):
        s = ""
        result = Solution().numWays(s)
        print(result)

    def test6(self):
        s = 90001 * '0'
        result = Solution().numWays(s)
        print(result)

if __name__ == '__main__':
    unittest.main()